import React, { Component } from 'react'
import actions from '../../RouteContainer/axiosCalls'

export default class GroupImage extends Component {
    render() {
        const displayFolder = async () => {
            let res = await actions.imageList()
            console.log(res)
          }

          const createReqBody = async () => {
            let res = await actions.addImg({
                name: 'Alex',
                description: 'asdasd',
                imageUrl: 'asdasd'
            }) 
            console.log(res)
          }

        return (
            <div>
                <button onClick={displayFolder}>Display Image Folder</button>
                <button onClick={createReqBody}>add img</button>
            </div>
        )
    }
}
